export class GridItem {
  constructor(i, x, y, w, h, title, text, image, alt) {
    this.i = i;
    this.x = x;
    this.y = y;
    this.w = w;
    this.h = h;
    this.title = title;
    this.text = text;
    this.image = image;
    this.alt = alt;
  }
}
